  \"2013-03-14T19:25:42.942541\",\n\t\"name\": \"san-diego-littoral-cell-crsmp-potential-offshore-borrow-areas-2009ed258\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Offshore sediment sources along the entire
  reach of the San Diego Coastal RSM Plan region were previously identified by SANDAG
  and used for Regional Beach Sand Projects (RBSP I) in 2001, and a few additional
  potential borrow sites were identified during development of the San Diego Region
  Coastal Regional Sediment Management Plan. Ten offshore borrow sites were previously
  investigated as part of RBSP I.SANDAG investigated many of the offshore potential
  sand deposits in 2008 as part of RBSP II. They used high resolution, multi-channel
  seismic technology along the entire region as a first step to identify candidate
  sites. This was followed by vibracoring at specific locations to retrieve, examine,
  and analyze physical samples. These recent sand investigations have yielded preliminary
  results of sand quality and quantity at the new sites, and at some of the previous
  sites as well. Sand quality as related to whether the deposits at those locations
  could be appropriate for beach restoration was assessed as: SM-1 is suitable to
  good; SO-7 yields no more sand; SO-6 is good to excellent; SO-5 is excellent (the
  investigation moved farther inshore than the area dredged in 2001); TP-1 is marginal;
  MB-1 is excellent; ZS-1 is poor; and SS-1 is suitable to good.Locations developed
  by Moffatt & Nichol and submitted to CSMW by SANDAG as part of the San Diego County
  Coastal Regional Sediment Management Plan (2009).\",\n\t\"license_title\": null,\n\t\"extras\":
